import React from 'react';

import Theme from '../containers/Theme/Theme';
import Ocean from '../assets/sunset.jpg';
import Mountain from '../assets/mountain.jpg';
import Rain from '../assets/rainy.jpg';

export function OceanWave() {
  return <Theme url="/assets/ocean.mp3" theme="ocean" bgImg={Ocean} />;
}

export function MountainView() {
  return <Theme url="/assets/mountain.mp3" theme="mountain" bgImg={Mountain} />;
}

export function RainyBeach() {
  return <Theme url="/assets/rain.mp3" theme="rain" bgImg={Rain} />;
}

